import React from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate();

  const handleVerTarefas = () => {
    navigate('/minhas-tarefas');
  };

  const handleNovaTarefa = () => {
    navigate('/nova-tarefa');
  };

  const handleGerenciarCategorias = () => {
    navigate('/categorias');
  };

  const handleGerenciarUsuarios = () => {
    navigate('/usuarios');
  };

  return (
    <div className="px-40 flex flex-1 justify-center py-5">
      <div className="layout-content-container flex flex-col max-w-[960px] flex-1">
        <h1 className="text-[#0d141c] tracking-light text-[32px] font-bold leading-tight px-4 text-center pb-3 pt-6">
          Bem-vindo ao TaskMaster
        </h1>
        <p className="text-[#0d141c] text-base font-normal leading-normal pb-6 pt-1 px-4 text-center">
          Organize suas tarefas de forma simples e eficiente
        </p>

        <div className="flex flex-col gap-4 px-4 py-3 max-w-md mx-auto w-full">
          <button
            onClick={handleVerTarefas}
            className="flex min-w-[84px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-12 px-6 bg-[#0c7ff2] text-slate-50 text-base font-bold leading-normal tracking-[0.015em] hover:bg-[#0a6cd9] transition-colors"
          >
            <span className="truncate">Ver Minhas Tarefas</span>
          </button>

          <button
            onClick={handleNovaTarefa}
            className="flex min-w-[84px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-12 px-6 bg-[#16a34a] text-slate-50 text-base font-bold leading-normal tracking-[0.015em] hover:bg-[#15803d] transition-colors"
          >
            <span className="truncate">Criar Nova Tarefa</span>
          </button>

          <div className="grid grid-cols-2 gap-4">
            <button
              onClick={handleGerenciarCategorias}
              className="flex min-w-[84px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-12 px-4 bg-[#e7edf4] text-[#0d141c] text-sm font-bold leading-normal tracking-[0.015em] hover:bg-[#d0dae5] transition-colors"
            >
              <span className="truncate">Categorias</span>
            </button>

            <button
              onClick={handleGerenciarUsuarios}
              className="flex min-w-[84px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-12 px-4 bg-[#e7edf4] text-[#0d141c] text-sm font-bold leading-normal tracking-[0.015em] hover:bg-[#d0dae5] transition-colors"
            >
              <span className="truncate">Usuários</span>
            </button>
          </div>
        </div>

        <div className="mt-8 px-4">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <div className="bg-white rounded-lg border border-[#e7edf4] p-6 text-center hover:shadow-md transition-shadow">
              <div className="text-[#0c7ff2] text-2xl font-bold mb-2">12</div>
              <p className="text-[#49739c] text-sm font-medium">Tarefas Pendentes</p>
            </div>
            
            <div className="bg-white rounded-lg border border-[#e7edf4] p-6 text-center hover:shadow-md transition-shadow">
              <div className="text-[#f59e0b] text-2xl font-bold mb-2">5</div>
              <p className="text-[#49739c] text-sm font-medium">Em Andamento</p>
            </div>
            
            <div className="bg-white rounded-lg border border-[#e7edf4] p-6 text-center hover:shadow-md transition-shadow">
              <div className="text-[#16a34a] text-2xl font-bold mb-2">8</div>
              <p className="text-[#49739c] text-sm font-medium">Concluídas</p>
            </div>
          </div>
        </div>

        <div className="mt-8 px-4 text-center">
          <p className="text-[#49739c] text-sm font-normal leading-normal">
            Sistema de gerenciamento de tarefas desenvolvido com React
          </p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
